/*
给你一个下标从 0 开始的数组 nums ，数组由若干 互不相同 的整数组成。

nums 中有一个值最小的元素和一个值最大的元素。分别称为 最小值 和 最大值 。你的目标是从数组中移除这两个元素。

一次 删除 操作定义为从数组的 前面 移除一个元素或从数组的 后面 移除一个元素。

返回将数组中最小值和最大值 都 移除需要的最小删除次数。
*/

#include <iostream>
#include <vector>
#include <algorithm>
#include <numeric>

using namespace std;

class Solution {
public:
    int minnum;
    int maxnum;
    int size;

    vector<vector<int>> table;
    int minimumDeletions(vector<int>& nums) {
        size = nums.size();
        maxnum = nums[0];
        minnum = nums[0];
        for (int num : nums) {
            if (num < minnum)
                minnum = num;
            if (num > maxnum) 
                maxnum = num;
        }

        table.resize(size, vector<int>(size, 0));

        return dfs(0, size-1, false, false, -1, nums, 0);

    }

    int dfs(int left, int right, bool delmax, bool delmin, int justdelnum, const vector<int>& nums,  int steps) {
        if (justdelnum == minnum)
            delmin = true;
        if (justdelnum == maxnum)
            delmax = true;
        if (delmin && delmax) {
            return steps;
        }

        if (left > right)
            return 0;
        if (table[left][right] != 0)
            return table[left][right];

        int result = min (dfs(left + 1, right, delmax, delmin, nums[left], nums, steps+1),  dfs(left, right-1, delmax, delmin, nums[right], nums, steps+1));
        table[left][right] = result;
        return result;
    }
};

